import React, {useState} from 'react';

function Step(props) {

      return (
          <div>
            <div onClick={props.onClick} className="step">
                    <h1>{props.title}</h1> 
            </div>
            { props.isActive && <div className="content">{props.content}</div> }
          </div>  
      )
}

export default Step;
